import React from 'react'
import ButtonM from '@material-ui/core/Button';

const Button = ({ buttonDisplayName , clickHandler}) => {
  return (
    <ButtonM onClick = { clickHandler } variant="contained" color="primary">
        {

        buttonDisplayName

        }
    </ButtonM>
  )
}

export default Button;
